  [4, 5, 6, "-"],
  [1, 2, 3, "+"],
  [0, ".", "="],
];

function App() {
  return (
    <div>
      <Wrapper>
        <Screen>
        <ButtonBox>

        </ButtonBox>
        </Screen>
      </Wrapper>
    </div>
  );
}

export default App;
